import React, { Component } from 'react';
import Item from './Item';
import PropTypes from 'prop-types';

class list extends Component {
  static propTypes = {
    Headerlogo: PropTypes.string.isRequired
  };
    constructor() {
        super();
    }

    list(data) {
        const children = (items) => {
          if (items) {
            return <ul className="submenu">{ this.list(items) }</ul>
        }
      }

      return data.map((node, index) => {
        return <Item key={ node.id } name={ node.name }>{ children(node.items) }</Item>
      })
    }

    render() {
      const { Headerlogo } = this.props; 
        return (
             <header>
                 <div className="container">
                      <div className="logo">
                          <img src={Headerlogo}/>   
                     </div>
                     <div className="header-btn">
                        <button class="btn btn-primary btn-sm pull-right" > Download</button>
                     </div>
                     <ul className="menu">
                        { this.list(this.props.data) }
                     </ul>


                 </div>
             </header>
        );
    }
}

export default list;
